import React, {
  Fragment,
  useRef,
  useState,
  useEffect
} from "react";
import {
  motion,
  useScroll,
  useSpring,
  useTransform,
  MotionValue
} from "framer-motion"

/* Styles */
import './notFound.scss'
import { func } from "prop-types";

function Item() {
  const ref = useRef(null);
  const { scrollYProgress } = useScroll({
    target: ref,
    offset: ["end end", "start start"]
  });

  return (
    <Fragment>
      <section className="test01">
        <div ref={ref}>
          
        </div>
      </section>
    </Fragment>
  );
};

export function NotFoundPage() {
  const [count, setcount] = useState(0);

  function increment() {
    setcount(this.count + 1);
  };

  return (
    <Fragment>
      <div className="notFound">
        <div className="header-sep"></div>
        <section className="nf_c01">
          <button onClick={increment()}>Click Me</button>
        </section>
        <section className="nf_c02">Tu le has dado click al boton {count} veces</section>
        <section className="component1">asd</section>
        <section className="component1">asd</section>
      </div>
    </Fragment>
  );
}
